import React from 'react';
import logo from '../../logo.png'

const Header = () => {
  return(
    <Nav>
      <ul className='Main-Nav'>
        <li><a href='#'><img src={logo}/></a></li>
      </ul>
    </Nav>
  );

}

export default Header;
